                            case Tags.NoDlvyInst: return new AllocationInstructionAlert.NoAllocsGroup.NoDlvyInstGroup();
                            case Tags.NoSettlPartyIDs: return new AllocationInstructionAlert.NoAllocsGroup.NoDlvyInstGroup.NoSettlPartyIDsGroup();
                            case Tags.NoSettlPartySubIDs: return new AllocationInstructionAlert.NoAllocsGroup.NoDlvyInstGroup.NoSettlPartyIDsGroup.NoSettlPartySubIDsGroup();
                        }
                        break;
                    }

                    case MsgTypes.ExecutionAcknowledgement:
                    {
                        switch (correspondingFieldID)
                        {
                            case Tags.NoSecurityAltID: return new ExecutionAcknowledgement.NoSecurityAltIDGroup();
                            case Tags.NoEvents: return new ExecutionAcknowledgement.NoEventsGroup();
                            case Tags.NoInstrumentParties: return new ExecutionAcknowledgement.NoInstrumentPartiesGroup();
                            case Tags.NoInstrumentPartySubIDs: return new ExecutionAcknowledgement.NoInstrumentPartiesGroup.NoInstrumentPartySubIDsGroup();
                            case Tags.NoUnderlyings: return new ExecutionAcknowledgement.NoUnderlyingsGroup();
                            case Tags.NoUnderlyingSecurityAltID: return new ExecutionAcknowledgement.NoUnderlyingsGroup.NoUnderlyingSecurityAltIDGroup();
                            case Tags.NoUnderlyingStips: return new ExecutionAcknowledgement.NoUnderlyingsGroup.NoUnderlyingStipsGroup();
                            case Tags.NoUndlyInstrumentParties: return new ExecutionAcknowledgement.NoUnderlyingsGroup.NoUndlyInstrumentPartiesGroup();
                            case Tags.NoUndlyInstrumentPartySubIDs: return new ExecutionAcknowledgement.NoUnderlyingsGroup.NoUndlyInstrumentPartiesGroup.NoUndlyInstrumentPartySubIDsGroup();
                            case Tags.NoLegs: return new ExecutionAcknowledgement.NoLegsGroup();
                            case Tags.NoLegSecurityAltID: return new ExecutionAcknowledgement.NoLegsGroup.NoLegSecurityAltIDGroup();
                        }
                        break;
                    }

                    case MsgTypes.TradingSessionList:
                    {
                        switch (correspondingFieldID)
                        {
                            case Tags.NoTradingSessions: return new TradingSessionList.NoTradingSessionsGroup();
                        }
                        break;
                    }

                }
                return null;
            }

        }
    }
}
